import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import GraphInput from "./components/GraphInput";
import GraphVisualization from "./components/GraphVisualization";
import Algorithms from "./components/Algorithms";
import { BinarySearchTrees } from "./components/BinarySearchTree";
import BinarySearchTree from "./components/BinarySearchTree";
import BSTVisualizer from "./components/BSTVisualizer";
import "./styles/App.css";

function HomePage({ onStart }) {
  return (
    <div className="start-page">
      <header>
        <h1>Website Wireframe</h1>
      </header>
      <div className="main">
        <div className="card">
          <h2>Graph Algorithm</h2>
          <Link to="/graph">
            <button className="start-button" onClick={() => onStart("graph")}>
              Start
            </button>
          </Link>
        </div>
        <div className="card">
          <h2>Data Structure</h2>
          <Link to="/data-structure">
            <button
              className="start-button"
              onClick={() => onStart("data-structure")}
            >
              Start
            </button>
          </Link>
        </div>
      </div>
      <footer>
        <p>Internet of Things</p>
        <p>2025</p>
      </footer>
    </div>
  );
}

function GraphPage({ resetGraph }) {
  const [matrix, setMatrix] = useState([]);
  const [vertices, setVertices] = useState([]);

  const handleMatrixSubmit = (newMatrix) => {
    setMatrix(newMatrix);
    setVertices(generateVertices(newMatrix.length));
  };

  const generateVertices = (count) => {
    const angleStep = (2 * Math.PI) / count;
    const radius = 150;

    return Array.from({ length: count }, (_, i) => ({
      x: 300 + radius * Math.cos(i * angleStep),
      y: 300 + radius * Math.sin(i * angleStep),
    }));
  };

  return (
    <div>
      <header>
        <h1>Graph Algorithms Visualization</h1>
        <Link to="/">
          <button className="back-button" onClick={resetGraph}>
            Back to Home
          </button>
        </Link>
      </header>
      <GraphInput onMatrixSubmit={handleMatrixSubmit} />
      <GraphVisualization matrix={matrix} vertices={vertices} />
      <Algorithms matrix={matrix} />
    </div>
  );
}

function DataStructurePage({ tree, setTree }) {
  const [inputValue, setInputValue] = useState("");
  const [message, setMessage] = useState("");

  const handleInsert = () => {
    if (inputValue) {
      tree.insert(parseInt(inputValue, 10));
      setTree(new BinarySearchTree(tree)); // Оновлюємо дерево
      setMessage(`Inserted ${inputValue}`);
      setInputValue("");
    }
  };

  const handleSearch = () => {
    if (inputValue) {
      const found = tree.find(parseInt(inputValue, 10));
      setMessage(found ? `Found ${inputValue}` : `${inputValue} not found`);
    }
  };

  const handleRemove = () => {
    if (inputValue) {
      tree.delete(parseInt(inputValue, 10));
      setTree(new BinarySearchTree(tree));
      setMessage(`Removed ${inputValue}`);
      setInputValue("");
    }
  };

  return (
    <div>
      <header>
        <h1>Data Structure Visualization (BST)</h1>
        <Link to="/">
          <button className="back-button">Back to Home</button>
        </Link>
      </header>
      <div>
        <label>Value: </label>
        <input
          type="number"
          value={inputValue}
          onChange={(e) => setInputValue(e.target.value)}
        />
        <button onClick={handleInsert}>Insert</button>
        <button onClick={handleSearch}>Search</button>
        <button onClick={handleRemove}>Remove</button>
      </div>
      <p>{message}</p>
      <BSTVisualizer tree={tree.getTree()} />
    </div>
  );
}

function App() {
  const [tree, setTree] = useState(new BinarySearchTree());

  const resetGraph = () => {
    // Місце для скидання стану графа, якщо потрібно
  };

  return (
    <Routes>
      <Route path="/" element={<HomePage />} />
      <Route path="/graph" element={<GraphPage resetGraph={resetGraph} />} />
      <Route
        path="/data-structure"
        element={<DataStructurePage tree={tree} setTree={setTree} />}
      />
    </Routes>
  );
}

export default function AppWrapper() {
  return (
    <Router>
      <App />
    </Router>
  );
}
